import React, { Component } from "react";

function table() {
  var a, i, t;
  a = 5;
  for (i = 1; i <= 10; i++) {
    t = a * i;
    document.write(" </br>" + t);
  }
}
table();

class App extends Component {
  render() {
    return <div className="container">heloo</div>;
  }
}

export default App;
